properties.description:
La Tempocasa di Cerenova propone in vendita una prestigiosa villa CON AMPIO GIARDINO E JACUZZI, così composta:

Tramite cancello carrabile accediamo al giardino, con impianto di irrigazione con timer, di circa 200 mq con possibilità di doppio posto auto coperto.

PIANO TERRA: 
- Doppio soggiorno con camino;
- Cucina abitabile;
- Bagno di servizio;
- Sottoscala.

Tramite la scala accediamo al PRIMO PIANO composto da:
- 2 camere da letto matrimoniali;
- Cameretta;
- Bagno con vasca;
- Balcone che collega le tre camere;
- TERRAZZO PANORAMICO vista mare;

La soluzione è situata in una zona tranquilla in un contesto residenziale a pochi passi dal mare.

Il presente annuncio è a scopo puramente informativo e non comporta alcun vincolo contrattuale.

ACQUISTO DIRETTO DA COSTRUTTORE
Acilia, via Eugenio Cecconi, in complesso residenziale di nuovissima costruzione, proponiamo in vendita splendide e spaziose villette angolari bilivelli con ampi giardini e doppio posto auto.
Gli immobili sono così composti:
Piano Terra: Salone con angolo cottura, Camera, Bagno, pergolato, giardino e posti auto;
Piano Primo: Due Camere da letto, Bagno, Terrazzo;
Finiture di lusso, impianto sorveglianza condominiale, impianto allarme privato, aria condizionata in entrambi i livelli, riscaldamento autonomo con pavimento radiante, pannelli solari/termici, videocitofono a colori, portoncino blindato, fotovoltaico 1kw, ampio giardino privato con prato all'inglese e impianto di irrigazione ed illuminazione, Classe energetica A +++, possibilità di personalizzazione

